Salo has two primitive types: Int and Str. More types are defined in the standard library, such as: Bool Nat Array Derivation Values are created with a type signature and value, as such: a : String
a = "Hello, world!" This is very similar to ML syntax. However, unlike many other ML languages, top-level values are not type inferred - you must explicitly write out the type of the value, whether or not it was possible for the computer to infer it. Uninitialized values in Salo are invalid and will throw a compiler error. This means that code like this won't work: b : String;
-- What is b's value? But, if you enter Salo in edit mode, b will be valid - or rather, it will be a hole. Holes are uninitialized values that allow you to understand more about the type requirements, without writing an implementation. We'll talk more about holes in [[Holes]]. Of course, Salo is also okay with delegating assignment until later on, as long as that value is not used: b : String; -- Other things can happen here, as long as they don't call `b`... b = "Hello, world!";
